export type UsersType = {
    id: number,
    name: string,
    email: string,
    phone: string
    username: string
}

export type ProductsType = {
    id: number,
    description: string,
    image: string,
    price: number,
    title: string,
    count: number
}

export interface StateType{
    cart: ProductsType[],
    current: UsersType,
    items: ProductsType[],
    users: UsersType[]
}

export type FormType = string | undefined

export type UserEmail = {username: string, email: string}

